    const ::Opm::ParserKeyword& operator[](const std::string& keyword) const
    {
        if (this->keywords.empty()) {
            this->emplaceA();
            this->emplaceB();
            this->emplaceC();
            this->emplaceD();
            this->emplaceE();
            this->emplaceF();
            this->emplaceG();
            this->emplaceH();
            this->emplaceI();
            this->emplaceJ();
            this->emplaceK();
            this->emplaceL();
            this->emplaceM();
            this->emplaceN();
            this->emplaceO();
            this->emplaceP();
            this->emplaceQ();
            this->emplaceR();
            this->emplaceS();
            this->emplaceT();
            this->emplaceU();
            this->emplaceV();
            this->emplaceW();
            this->emplaceX();
            this->emplaceY();
            this->emplaceZ();
        }

        const auto kw_iter = this->keywords.find(keyword);
        if (kw_iter == this->keywords.end()) {
            throw std::invalid_argument(fmt::format("No builtin keyword: {}", keyword));
        }

        return kw_iter->second;
    }

    const ::Opm::ParserKeyword& getKeyword(const std::string& keyword) const
    { return (*this)[keyword]; }

